pragma solidity ^0.4.18;

import "zeppelin-solidity/contracts/token/ERC721/ERC721Token.sol";
import "./TrancheRegistry.sol";

contract Tranche is ERC721Token {

   TrancheRegistry public registry;
   uint256 internal _saltCounter;

   /**
    * Constructor that sets the address of the debt registry.
    */
   function Tranche(address _registry)
       public
       ERC721Token("DharmaTrancheToken", "DTT")
   {
       registry = TrancheRegistry(_registry);
   }

   function mintTrancheToken(address beneficiary, address cdo, uint priority) public returns(bytes32) {

      bytes32 entryHash = registry.insert(
         beneficiary,
         cdo,
         priority,
         _saltCounter
      );

      super._mint(beneficiary, uint(entryHash));
      _saltCounter++;

      return entryHash;
   }

   /**
    * We oveerride the core ownership getter of the parent non-fungible token
    * contract so that it retrieves the debt's current beneficiary from the debt registry
    */
   function _ownerOf(uint _tokenID)
       internal
       view
       returns (address _owner)
   {
       return registry.getBeneficiary(bytes32(_tokenID));
   }

}
